import React from 'react';
import Space from './space';

const Board = ({ space, capture }) => {
	return (
		<div className="board">
			{space.map((space, index) => {
				return (
					<Space
						key={index}
						index={index}
						space={space}
						onClick={() => {
							capture(index);
						}}
					/>
				);
			})}
		</div>
	);
};

export default Board;
